  input: TEXT,SA11A1,SA11A1.71587,"On 6/11/07 we received a contribution from Trevor
    Gray in the amount of $30,000, which was deposited into our federal account.  Ten
    thousand dollars was reattributed to Trevor's spouse, Edna Gray.  Ten thousand
    dollars was transferred to our non-federal account, which can accept unlimited
    contributions from individuals, on 6/12/07.  A letter was sent to Trevor & Edna
    Gray explaining to them of how thier contribution was split into our accounts
    and to offer them a chance for a refund.  According to AO 2001-17, the Commission
    has deemed it sufficient to deposit checks that exceed the donor's federal limits
    into our federal account and then to make a transfer to the non-federal account
    for the portion that is over the federal limit.  Therefore year to date aggregate
    totals reported by Trevor Gray on our report is a reflection of the federal portion
    of the donor's contribution to date."
